import './Intro.css'
import Facebook from '../../img/Facebook1.png';
import Instagram from '../../img/instagram.png';
import Whatsapp from '../../img/linkedin.png';
import Vector1 from '../../img/Vector1.png';
import Vector2 from '../../img/Vector2.png';
import Thumbup from '../../img/thumbup.png';
import Crown from '../../img/crown.png';
import Glasses from '../../img/glassesimoji.png';

const Intro = () => {
  return (
    <div className="intro">
        <div className="i-left">
            <div className="i-name">
                <span>Alpine Domicile</span>
                <span>"Building Dreams, Building Realities"</span>
                <span>Alpine Domicile is here to serve you in all your construction and building projects, We turn your dreams into reality!</span>
            </div>
            <button className="button i-button">Contact Us</button>
            <div className="i-icons">
                <a href="#"><img src={Facebook} alt="FB" /></a>
                <a href="#"><img src={Instagram} alt="IG" /></a>
                <a href="#"><img src={Whatsapp} alt="WB" /></a>
            </div>
            </div>

        <div className="i-right">
            <span>Right side text</span>
        </div>
    </div>
  )
}

export default Intro
